import React from "react";

const Footer = () => {
  return (
    <footer>
      <div>img</div>
      <div>
        <div>
          <h5>ABOUT US</h5>
          <p>
            Sed ut perspiciatis unde omnis iste natus error sit voluptatem
            accusan-tium doloremque laudantium, totam rem aperiam,
          </p>
        </div>

        <div>
          <h5>GET NEWS & OFFERS</h5>
          <input type="email" />
        </div>
      </div>
    </footer>
  );
};

export default Footer;
